import React, { useState } from 'react';
import './Schedule.css';

const Schedule = () => {
  const [currentWeek, setCurrentWeek] = useState(new Date());
  const [selectedTeam, setSelectedTeam] = useState('This week');

  // Sample data matching the Float interface
  const teamMembers = [
    {
      id: 1,
      initials: 'RR',
      name: 'Recekesavan R',
      role: 'Team Lead',
      hours: '32h',
      color: '#4CAF50'
    },
    {
      id: 2,
      initials: 'S',
      name: 'Sastha',
      role: 'Recekesavan Team',
      hours: '16.5h',
      color: '#FF9800'
    },
    {
      id: 3,
      initials: 'J',
      name: 'Jakhir',
      role: 'Team Lead',
      hours: '16h',
      color: '#2196F3'
    },
    {
      id: 4,
      initials: 'I',
      name: 'Ibrahim',
      role: 'Recekesavan Team',
      hours: '16h',
      color: '#9C27B0'
    },
    {
      id: 5,
      initials: 'RK',
      name: 'Ram kumar',
      role: 'Team Lead',
      hours: '40h',
      color: '#F44336'
    }
  ];

  const tasks = [
    {
      id: 1,
      personId: 1,
      day: 'Wed 30',
      title: 'Submittal d Auburn Vist',
      hours: '4h',
      color: '#F44336'
    },
    {
      id: 2,
      personId: 1,
      day: 'Wed 30',
      title: 'No Task Dakota Affo',
      hours: '4h',
      color: '#4CAF50'
    },
    {
      id: 3,
      personId: 2,
      day: 'Mon 28',
      title: 'Level 3 - Ai Sand Canyc EDC',
      hours: '7.5h',
      color: '#FFE0B2'
    },
    {
      id: 4,
      personId: 2,
      day: 'Tue 29',
      title: 'Level 3 - Ai Sand Canyc EDC',
      hours: '8h',
      color: '#FFE0B2'
    },
    {
      id: 5,
      personId: 2,
      day: 'Wed 30',
      title: 'Level 3 - Ai Sand Canyc EDC',
      hours: '8h',
      color: '#FFE0B2'
    },
    {
      id: 6,
      personId: 3,
      day: 'Thu 31',
      title: 'No Task Sand Canyon Plaza EDC',
      hours: '8h',
      color: '#FFE0B2'
    },
    {
      id: 7,
      personId: 3,
      day: 'Fri 1',
      title: 'No Task Sand Canyc EDC',
      hours: '8h',
      color: '#FFE0B2'
    },
    {
      id: 8,
      personId: 4,
      day: 'Mon 28',
      title: 'Level 3 - Ai Sand Canyc EDC',
      hours: '8h',
      color: '#FFE0B2'
    },
    {
      id: 9,
      personId: 4,
      day: 'Tue 29',
      title: 'Level 3 - Ai Sand Canyc EDC',
      hours: '8h',
      color: '#FFE0B2'
    },
    {
      id: 10,
      personId: 4,
      day: 'Wed 30',
      title: 'Level 3 - Ai Sand Canyc EDC',
      hours: '8h',
      color: '#FFE0B2'
    }
  ];

  const days = [
    'Mon 28', 'Tue 29', 'Wed 30', 'Thu 31', 'Fri 1', 'Sat 2', 'Sun 3',
    'Mon 4', 'Tue 5', 'Wed 6', 'Thu 7', 'Fri 8', 'Sat 9'
  ];

  const getTasksForPersonAndDay = (personId, day) => {
    return tasks.filter(task => task.personId === personId && task.day === day);
  };

  const formatDate = (date) => {
    return date.toLocaleDateString('en-US', { 
      month: 'short', 
      day: 'numeric' 
    });
  };

  return (
    <div className="schedule-container">
      {/* Header */}
      <div className="schedule-header">
        <div className="header-left">
          <div className="team-selector">
            <span className="team-icon">üë•</span>
            <span className="team-dropdown">{selectedTeam} ‚ñº</span>
          </div>
          <span className="total-hours">816.5h</span>
        </div>

        <div className="header-center">
          <h2>Jul - Aug</h2>
          <span className="current-day">Thu 31</span>
        </div>

        <div className="header-right">
          <button className="nav-btn">‚Üê</button>
          <button className="nav-btn">‚Üí</button>
          <button className="today-btn">Today</button>
          <select className="view-selector">
            <option>Weeks</option>
          </select>
          <button className="icon-btn">‚öôÔ∏è</button>
          <button className="icon-btn">üì§</button>
          <button className="icon-btn">+</button>
        </div>
      </div>

      {/* Schedule Grid */}
      <div className="schedule-grid">
        {/* Days Header */}
        <div className="days-header">
          <div className="person-header"></div>
          {days.map((day, index) => (
            <div key={index} className="day-header">
              {day}
            </div>
          ))}
        </div>

        {/* People Rows */}
        {teamMembers.map((person) => (
          <div key={person.id} className="person-row">
            {/* Person Info */}
            <div className="person-info">
              <div className="person-avatar" style={{ backgroundColor: person.color }}>
                {person.initials}
              </div>
              <div className="person-details">
                <div className="person-name">{person.name}</div>
                <div className="person-role">{person.role}</div>
              </div>
              <div className="person-hours">{person.hours}</div>
            </div>

            {/* Task Blocks */}
            {days.map((day, dayIndex) => (
              <div key={dayIndex} className="day-cell">
                {getTasksForPersonAndDay(person.id, day).map((task) => (
                  <div 
                    key={task.id} 
                    className="task-block"
                    style={{ backgroundColor: task.color }}
                  >
                    <div className="task-title">{task.title}</div>
                    <div className="task-hours">{task.hours}</div>
                  </div>
                ))}
              </div>
            ))}
          </div>
        ))}
      </div>

      {/* Trial Notice */}
      <div className="trial-notice">
        15 days left on your trial. Need help?
      </div>
    </div>
  );
};

export default Schedule;
